import React from 'react';
import ReturnPhoneRegister from './Phone';

import { auth } from '../../firebase';
import SignUp from '../../Sign/Main';

// This Phone view
export default function RegisterPhone() {

 const [people, setPleople] = React.useState();
 const user = auth.currentUser;
 React.useEffect(() => {
  setPleople(user);
 }, []);

 return (
  <>
   {people ? <ReturnPhoneRegister /> : <SignUp />}
  </>
 );
};
